FundMe.sol.content:
// Get funds from users
// Withdraw funds
// Set a minimum fund value in USD

// SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe{

    uint256 public minimumUsd = 50;

    function fund() public payable{ 
        // Want to vbe able to set a min fund value in USD
        // how do we send eth to this contract
        require(msg.value >= minimumUsd, "Didn't send enough"); //1e18 == 1*10**18 == 1000000000000000000

    }

    function getprice() public view returns(uint256) {
        // ABI  
        // ADDRESS 	0x8A753747A1Fa494EC906cE90E9f37563A8AF630e

        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        (,int256 price,,,) = priceFeed.latestRoundData();
        //ETH in terms of USD
        //3000.00000000
        return uint256(price * 1e10); //1**10 == 10000000000
    }

    function getConversionRate(uint256 ethAmount) public {}

    // function withdraw(){}
}

